// Browser Detection and Support (Stuff Modernizr Doesn't Do!).
var info = {

    windowWidth: function(){
        return window.innerWidth;
    },

    windowHeight: function(){
         return window.innerHeight;
    },

    browser: function(version){
        var dataBrowser = [
            { string: navigator.userAgent, subString: "Chrome",  identity: "Chrome" },
            { string: navigator.userAgent, subString: "MSIE",    identity: "IE" },
            { string: navigator.userAgent, subString: "Firefox", identity: "Firefox" },
            { string: navigator.userAgent, subString: "Safari",  identity: "Safari" },
            { string: navigator.userAgent, subString: "Opera",   identity: "Opera" },
        ];
        function searchString (data){
            for (i=0; i<data.length; i++){
                var dataString = data[i].string;
                    this.versionSearchString = data[i].subString;
                if (dataString.indexOf(data[i].subString) != -1){
                    return data[i].identity;
                }
            }
        }
        function searchVersion (dataString){
            var index = dataString.indexOf(this.versionSearchString);
            if (index == -1) return;
            return parseFloat(dataString.substring(index+this.versionSearchString.length+1));
        }
        if(version){
            return searchVersion(navigator.userAgent) || searchVersion(navigator.appVersion) || "Unknown";
        }
        return searchString(dataBrowser) || "Other";
    },

    flash: function(){
        try {
            var flashEnabled = !!(navigator.mimeTypes["application/x-shockwave-flash"] || window.ActiveXObject && new ActiveXObject('ShockwaveFlash.ShockwaveFlash'));
            if(flashEnabled){
                return true;
            }
        } catch(e) {
            return false;
        }
        return false;
    }

}

